description:
Contains a SQLite3 database - isc-anon.db

MD5 (isc-anon.db) = a66ae071e00d000f5b439d1de955b920

Contains 3 tables with 205,982 records with the following schema:

CREATE TABLE schools ( id INTEGER PRIMARY KEY AUTOINCREMENT, school TEXT,school_id INTEGER );

CREATE TABLE subjects ( id INTEGER PRIMARY KEY AUTOINCREMENT, tla_code TEXT,board_code INTEGER,name TEXT,sub_group TEXT,notes TEXT );

CREATE TABLE anon_scores ( id INTEGER PRIMARY KEY AUTOINCREMENT, ds TEXT,anonymized_name TEXT,school TEXT,area TEXT,school_id TEXT,eng_top_three REAL,top_four REAL,ENG INTEGER,MAT INTEGER,PHY INTEGER,CHE INTEGER,ECO INTEGER,ACC INTEGER,COM INTEGER,CTS INTEGER,BIO INTEGER,PED INTEGER,BST INTEGER,PSC INTEGER,GEO INTEGER,HIS INTEGER,ART INTEGER,SOC INTEGER,PSY INTEGER,EVS INTEGER,HOM INTEGER,BTN INTEGER,LIT INTEGER,IMH INTEGER,IMC INTEGER,WMC INTEGER,GMD INTEGER,GBD INTEGER,FDS INTEGER,ELE INTEGER,EED INTEGER,HIN INTEGER,BEN INTEGER,PUN INTEGER,NEP INTEGER,GUJ INTEGER,MAR INTEGER,URD INTEGER,MZO INTEGER,TIB INTEGER,ASM INTEGER,DZO INTEGER,POR INTEGER,ORI INTEGER,MAN INTEGER,TEL INTEGER,MAL INTEGER,TAM INTEGER,KAN INTEGER,TAN INTEGER,LEP INTEGER,LUS INTEGER,KHA INTEGER,ANG INTEGER,GAR INTEGER,SAN INTEGER,ARB INTEGER,PER INTEGER,CHI INTEGER,FRE INTEGER,SPA INTEGER,RUS INTEGER,GER INTEGER,KOR INTEGER,DUT INTEGER,THA INTEGER,ARM INTEGER,KIS INTEGER,ODE INTEGER,RUP INTEGER,TOR INTEGER );


The three letter acronyms in the anon_scores can be joined with subjects to figure out the subject name. 

